import React from "react";

function Cart(props) {
  return (
    <div className="col-md-4 col-sm-6">
      <div className="card">
        <div className="card-header">
          <img  className=" img-thumbnail " src={props.info.img} style={{maxWidth:'100%'}} alt="gfsd"/>
        </div>
        <div className="card-body">
          <div> <h3>name : {props.info.name}</h3> </div>
          <div> <h3>Email : {props.info.email}</h3></div>
          <div> Phone : {props.info.phone}</div>
        </div>
      </div>
    </div>
  );
}
export default Cart;
